import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Hello world
      </header>
    </div>
  );
}

function Demo() {
  return (
    <div className="App">
      <header className="App-header">
        Demo componant
      </header>
    </div>
  );
}

export default App;
